import React from 'react';
import {
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Typography,
    Box
} from '@mui/material';
import { GraphData } from '../types/graphTypes';

interface ResultsTableProps {
    data: GraphData;
}

const ResultsTable: React.FC<ResultsTableProps> = ({ data }) => {
    return (
        <Box sx={{ mt: 3 }}>
            <Typography variant="h6" gutterBottom>
                Résultats de l'ordonnancement
            </Typography>

            {/* Tableau des rangs */}
            <TableContainer component={Paper} sx={{ mb: 3 }}>
                <Typography variant="subtitle1" sx={{ p: 2 }}>
                    Rangs des tâches
                </Typography>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Tâche</TableCell>
                            <TableCell>Rang</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {Object.entries(data.ranks).map(([task, rank]) => (
                            <TableRow key={task}>
                                <TableCell>{task}</TableCell>
                                <TableCell>{rank}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            {/* Tableau du calendrier */}
            <TableContainer component={Paper}>
                <Typography variant="subtitle1" sx={{ p: 2 }}>
                    Calendrier et marges
                </Typography>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Tâche</TableCell>
                            <TableCell>Date au plus tôt</TableCell>
                            <TableCell>Date au plus tard</TableCell>
                            <TableCell>Marge totale</TableCell>
                            <TableCell>Marge libre</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.graph.nodes.map((node, index) => (
                            <TableRow 
                                key={node.id}
                                sx={data.criticalPath.includes(node.id) ? { 
                                    backgroundColor: 'rgba(255, 118, 117, 0.1)' 
                                } : {}}
                            >
                                <TableCell>{node.label}</TableCell>
                                <TableCell>{node.early_date}</TableCell>
                                <TableCell>{node.late_date}</TableCell>
                                <TableCell>{node.total_margin}</TableCell>
                                <TableCell>{node.free_margin}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </Box>
    );
};

export default ResultsTable;
